import copy from '../copy.json';

function Capabilities() {
  const listItems = data.map((d) => <li key={d.name}>{d.name}</li>);
  return (
    <li>{listItems(copy.Capabilities.Materials.Aluminum)}</li>
  );
}

export default Capabilities;
